import React from "react";
import Navbar from "./components/navbar";
import "./App.css";
import headerImg from "./assets/PicForHeader.svg"; 

function App() {
  return (
    <div className="app">
      <img src={headerImg} alt="Header" className="header-img" />
      <Navbar />
      <h1>Willkommen bei TeeShop</h1>
    </div>
  );
}

export default App;
